import React, { useState, useEffect, useCallback, useRef } from "react";
import { Routes, Route, Link } from "react-router-dom";
import { Container, Navbar, Nav } from "react-bootstrap";
import { GoogleOAuthProvider } from "@react-oauth/google";

import MoviesList from "./components/MoviesList";
import Movie from "./components/Movie";
import AddReview from "./components/AddReview";
import Login from "./components/Login";
import Logout from "./components/Logout";
import Favorites from "./components/Favorites";

import { getFavorites, updateFavorites } from "./services/favorites";

import "./App.css";

const clientId = "510875697640-tck18ehc7i280k3k7qphjthjrn9l0hbd.apps.googleusercontent.com";

function App() {
  const [user, setUser] = useState(null);
  const [favorites, setFavorites] = useState([]);
  const isFirstLoad = useRef(true);

  const loadFavorites = useCallback(async () => {
    console.log('Loading favorites for user:', user);
    if (user && user.googleId) {
      try {
        const data = await getFavorites(user.googleId);
        console.log('Favorites data loaded:', data);
        setFavorites(data.favorites || []);
      } catch (e) {
        console.error('Error loading favorites:', e);
        setFavorites([]);
      }
    } else {
      console.log('No user or googleId, setting empty favorites');
      setFavorites([]);
    }
  }, [user, setFavorites]);

  useEffect(() => {
    const initializeFavorites = async () => {
      await loadFavorites();
      isFirstLoad.current = false;
    };
    initializeFavorites();
  }, [loadFavorites]);

  useEffect(() => {
    if (!isFirstLoad.current && user && user.googleId) {
      const saveFavorites = async () => {
        try {
          console.log('Saving favorites:', favorites, 'for user:', user.googleId);
          await updateFavorites(user.googleId, favorites);
          console.log('Favorites saved successfully');
        } catch (error) {
          console.error('Error updating favorites:', error);
        }
      };
      saveFavorites();
    }
  }, [favorites, user]);

  useEffect(() => {
    console.log("user", user);
  }, [user]);

  const addFavorite = (movieId) => {
    console.log('Adding favorite:', movieId, 'User:', user);
    if (!favorites.includes(movieId)) {
      setFavorites((prev) => [...prev, movieId]);
    }
  };

  const deleteFavorite = (movieId) => {
    console.log('Deleting favorite:', movieId, 'User:', user);
    setFavorites((prev) => prev.filter((f) => f !== movieId));
  };

  useEffect(() => {
    let loginData = JSON.parse(localStorage.getItem("login"));
    if (loginData) {
      let loginExp = loginData.exp;
      let now = Date.now() / 1000;
      if (now < loginExp) {
        setUser(loginData);
      } else {
        localStorage.setItem("login", null);
      }
    }
  }, []);

  return (
    <GoogleOAuthProvider clientId={clientId}>
      <div className="App">
        <Navbar bg="primary" expand="lg" sticky="top" variant="dark">
          <Container className="container-fluid">
            <Navbar.Brand href="/" className="brand">
              <img 
                src="/images/movies-logo.png" 
                alt="movies logo" 
                className="moviesLogo"
                onError={(e) => {
                  console.log("Logo failed to load:", e.target.src);
                  e.target.style.display = 'none';
                }}
                onLoad={() => {
                  console.log("Logo loaded successfully");
                }}
              />
              MOVIE TIME
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
              <Nav className="ml-auto">
                <Nav.Link as={Link} to="/movies" className="link">
                  Movies
                </Nav.Link>
                <Nav.Link as={Link} to="/favorites" className="link">
                  Favorites
                </Nav.Link>
              </Nav>
              { user ? (
                  <Logout setUser={setUser} clientId={clientId} />
                ) : (
                  <Login setUser={setUser} />
              )}
            </Navbar.Collapse>
          </Container>
        </Navbar>

        <Routes>
          <Route exact path={"/"} element={
            <MoviesList
              user={user}
              favorites={favorites}
              addFavorite={addFavorite}
              deleteFavorite={deleteFavorite}
            />
          } />
          <Route exact path={"/movies"} element={
            <MoviesList
              user={user}
              favorites={favorites}
              addFavorite={addFavorite}
              deleteFavorite={deleteFavorite}
            />
          } />
          <Route path={"/movies/:id"} element={
            <Movie user={user} />
          } />
          <Route path={"/movies/:id/review"} element={<AddReview user={user} />} />
          <Route path={"/favorites"} element={<Favorites user={user} />} />
        </Routes>
      </div>
    </GoogleOAuthProvider>
  );
}

export default App;
